import React, { useState } from 'react';
import { Link } from 'react-router-dom';

export default function Posts(props) {
  const { posts } = props
  return (
    <div>
      <h3>This is all posts feed</h3>
      {
        posts.map(post => (
          <p key={post.id}>
            {post.title}
            {post.activity_type}
            {post.distance}
            {post.elevation_gain}
            {post.duration}
            {/* <img src={post.activity_photo} alt={post.title} /> */}
          </p>
        ))
      }
    </div>
  )
}
